import React, {useCallback} from 'react'
import { useSelector } from 'react-redux'

const History = () => {
  const state = useSelector((counter) => counter.num.history)

  const rerender = useCallback(() => {
    if (!state) return <div>История пуста</div>
    return state.map((value) => (
      <div>
        {value}
      </div>
    ))
  }, [state])

  console.log(state)
  return (
    <div>
      {rerender()}
    </div>
  )
}

export default History
